css:
@-moz-document domain("google.com") {
body {
	background-color: #424242;
}
h1 {
	color: #ffffff;
}
h2 {
	color: #ededed;
}
h3 {
	color: #e0e0e0;
}
h4 {
	color: #dbdbdb;
}
h5 {
	color: #d1d1d1;
}
h6 {
	color: #c9c9c9;
}
a {
	color: white;
	text-decoration: none;
}
input {
	background-color: black;
	border: none;
	border-radius: 2%;
	color: white;
}
button {
	background-color: black;
	border: none;
	border-radius: 2%;
}
div, .sfbg, .yg51vc, .tsf, .CvDJxb, select, .VmOpGe, textarea {
	/* Selectors provide styles for Google obfuscated CSS garbage */
	box-shadow: 0 -7px 100px rgba(0, 0, 0, 0.2);
	background-color: rgb(0, 0, 0);
	color: white;
}
}
